[{"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "Diabetes Mellitus", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?descriptor ?label ?treeNumber
WHERE {
  ?descriptor a meshv:Descriptor ;
              rdfs:label ?label ;
              meshv:treeNumber ?tn .
  ?tn meshv:treeNumber ?treeNumber .
  FILTER(REGEX(?label, "^Diabetes Mellitus$", "i"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX mesh: <http://id.nlm.nih.gov/mesh/>

SELECT ?label ?treeNumber
WHERE {
  mesh:D003920 a meshv:Descriptor ;
               rdfs:label ?label ;
               meshv:treeNumber ?tn .
  ?tn meshv:treeNumber ?treeNumber .
}
LIMIT 20"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mesh"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX mesh: <http://id.nlm.nih.gov/mesh/>
PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?label ?treeNumber
FROM <http://id.nlm.nih.gov/mesh>
WHERE {
  mesh:D003920 rdfs:label ?label .
  mesh:D003920 meshv:treeNumber ?tree .
  ?tree rdfs:label ?treeNumber
}"}}]

[{"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "15365", "route": "chebi,pubchem"}}, {"name": "mcp__pubdictionaries__find_terms", "input": {"ids": "CHEBI:15365", "dictionary": "ChEBI"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "
PREFIX chebi: <http://purl.obolibrary.org/obo/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?label ?pubchemId
WHERE {
  chebi:CHEBI_15365 skos:altLabel ?label .
  OPTIONAL { chebi:CHEBI_15365 ?p ?pubchemId . FILTER(CONTAINS(STR(?pubchemId), "pubchem")) }
}
LIMIT 10
"}}, {"name": "mcp__ols__fetch", "input": {"id": "chebi+http://purl.obolibrary.org/obo/CHEBI_15365"}}, {"name": "mcp__togomcp__get_pubchem_compound_id", "input": {"compound_name": "acetylsalicylic acid"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?identifier ?en_label ?ja_label ?notif_num ?description
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           dct:identifier ?identifier ;
           rdfs:label ?en_label ;
           nando:hasNotificationNumber ?notif_num .
  ?disease rdfs:label ?ja_label .
  OPTIONAL { ?disease dct:description ?description . }

  FILTER(LANG(?en_label) = "en")
  FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[ぁ-ん]+$"))
  ?en_label bif:contains "'Spinal*' AND 'bulbar*'" option (score ?sc) .
}
ORDER BY DESC(?sc)
LIMIT 5"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) as ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          schema:hasDomain ?domain .
  FILTER(CONTAINS(LCASE(?domain), "archaea"))
}"}}]
